import "./App.css";
import Header from "./components/Header";
function App() {
  return (
    <div className="App-container">
      <div className="App">
        <Header />
        <div className="a">
          <video controls muted className="video-container">
            <source
              src="https://www.youtube.com/watch?v=Gh9YMI6dVc"
              type="video/mp4"
            ></source>
          </video>
        </div>
      </div>
    </div>
  );
}

export default App;
